import React from 'react';
import styled from "styled-components";

const StyledLogo = styled.a`
  display: flex;
  
`

function Logo() {
  return (
    <StyledLogo href="/">
      <img src="./img/common/logo.svg" alt="Logo"/>
      <div></div>
    </StyledLogo>
  );
}

export default Logo;
